import React, { Component } from 'react';
import Head from 'next/head'
import SignUP from "../component/SignUp"

  class Index extends Component{
      render(){
          return(
              <div>
              <Head>
                  <title>Job Website</title>
              </Head>
              <div>
                  <SignUP />
              </div>
              </div>
          )
      }
  }
  
  export default Index;
